We can use unit conversions to solve this problem. 
\begin{align*}
2 \text{ decagrams} &= 2 \cdot 10 \text{ grams} &= 20 \text{ grams} \\
20 \text{ grams} &= 20 \cdot 1000 \text{ milligrams} &= 20,000 \text{ milligrams}
\end{align*}
Therefore, there are 20,000 milligrams in one 2-decagram container. 

