The probability that the person belonged to Group Y when chosen at random from those who recalled at least 1 dream is the number of people in Group Y who recalled 1 or more dreams divided by the total number of people who recalled 1 or more dreams.

Out of the 39 people who recalled 1 or more dreams, 68 - 21 = 47 people are from Group Y. So the probability is:

\begin{align*}
\frac{47}{39} &= \frac{47}{125 - 36} \\
&= \frac{47}{89} \\
&= \boxed{\textbf{(C) } \frac{79}{164}}
\end{align*}
